description:
The better the sex, the better the student body.
Kyra hates everything - school, the teachers, and especially Zadie who is messing around with the boy she'd like to date. It's time to get busy and screw things up for Zadie and a teacher or two in a very big way! Starring Carter Cruise as the sexy scheming schoolgirl, seductive Katerina Kay as her friend, smart and sassy Casey Calvert as her nemesis and the beautiful Kelly Diamond as the sweet little schoolgirl that really did do the teacher.

Carter Cruise,Casey Calvert,Kelly Diamond,Katerina Kay,Evan Stone,Xander Corvus,Chad Alva

